import React from 'react'
import './Navbar.css'
import logoo from '..'
const Navbar = () => {
  return (
    <div className='navbar'> 
      <div className='logo'>
        <img src={logoo} alt=""/>
      </div>
    </div>
  )
}

export default Navbar
